values:
Also, I dont' know what to do next year. Let's face it, there's not much keeping me here. I stayed at the end of last year because I wanted to be close to my nii-san, also Freckles was a factor. But this year? I'll be living with Lowri who has the unconscious ability&nbsp;to make me feel as shit as I ever have, I have a shit job, though hopefully that'll change. Money sucks. Hopefully that'll change. The deciding factor is Gemma. If I can have a proper conversation with her tomorrow, if I can talk about this, if it just seems to work then I'll stay, if only for a year. If, if if... Well, we'll see in a few hours hey?

I cried too loudly. Mark heard me and offered me his shoulder. His dressing gown is incredibly soft. And he smells like clean, like detergent and fags. Like my Mark. Like home. God, I miss home.&nbsp;

&lt;/emo angst&gt;
